function jamaahInfo(){
    if ($('#jamaahInfo').val() == "") {
        return false;
    } else {
        $('#loading').show();
        $('#successAjx').hide();
        $('#failsAjx').hide();
        request = $.ajax({
        url: "/api/jamaah-info",
        type: "post",
        data: {
            nomor: $('#jamaahInfo').val()
        },
            success:function(data) {
                
                if (data['status'] == 400) {
                    console.log(data);
                    $('#loading').hide();
                    $('#successAjx').hide();
                    $('#failsAjx').show();
                } else {
                    alamat = data['data']['alamat'] +', '+ data['data']['kecamatan']+', '+data['data']['provinsi'];
                    $('#nama').html(data['data']['nama_jamaah']);
                    $('#jm-foto').attr('src', data['data']['foto']);
                    $('#tipe_produk').html(data['data']['nama_produk']);
                    $('#alamat').html(alamat);
                    $('#tgl_keberangkatan').html(data['data']['tanggal_keberangkatan']);
                    $('#loading').hide();
                    $('#failsAjx').hide();
                    $('#successAjx').show();
                    return true;
                    console.log(data);
                }
                
                
            }
        });
    }
}

